      </div>
      <div className={classes.box}>
        <img src="./assets/CloudComputing.jpg"></img>
        <div className="para">
          <h4>By abc</h4>
          <p>
            Lorem ipsum dolor Lorem ipsum dolor sit amet. Ut laudantium adipisci
